import React from "react";
import { Card } from "react-bootstrap";

const Contacts = ({ name, email, phone }) => {
  return (
    <Card style={{ width: "18rem" }}>
      <Card.Body className="mb-3">
        {name}
        <ul>
          <li>
            <div>{email}</div>
          </li>
          <li>
            <div>{phone}</div>
          </li>
        </ul>
      </Card.Body>
    </Card>
  );
};

const title = {
  fontSize: 20
};

export default Contacts;
